###   logic   ###
#################

_dataset_dict = {
    "RE04": _data_RE04,
    "RE16": _data_RE16,
    "ET187": _data_ET187,
    "W3": _data_W3,
    "BJY2": _data_BJY2a
}

_dataset_selection_dict = {
    "RE04": _data_RE04_selection,
    "RE16": _data_RE16_selection,
    "ET187": _data_ET187_selection,
    "W3": _data_W3_selection,
    "BJY2": _data_BJY2a_selection
}


def get(specimen, selection=False):

    # select the right dataset dictionary
    dict = _dataset_dict
    if selection:
        dict = _dataset_selection_dict

    # check if the specimen is in the dict
    if (specimen in dict) == False:
        print("WARNING: the specimen %s is not present in the demo data, asked for a selection: %s" % (specimen, selection))
        return []
    else:
        return _demo_data_to_real_format_thermal(dict[specimen])


def _demo_data_to_real_format_thermal(l):
    result = []
    for msrmt in l:
        result.append({
            "site": msrmt[0],
            "specimen": msrmt[1],
            "x": msrmt[2],
            "y": msrmt[3],
            "z": msrmt[4],
            "error": msrmt[5],
            "dec": msrmt[6],
            "inc": msrmt[7],
            "total_m": msrmt[8],
            "date": msrmt[9],
            "time": msrmt[10],
            "step": msrmt[11],
            "lab_field": msrmt[12],
            "lab_field_dec": msrmt[13],
            "lab_field_inc": msrmt[14],
            "type": msrmt[15],
            "previous_step": msrmt[16]
        })
    return result
